import { useState } from "react"

const Tasks = () => {
    const [tasks, setTasks] = useState([
        {
            id: 1,
            text: "Appointment"
        }
    ])

    return (
        <>
            {tasks.map((task) => (
                <h3 key={task.id}>{task.text}</h3>
            ))}
        </>
    )
}

export default Tasks
